import styles from "./../../assets/views/pages/Java.module.css";

import Service from "../../components/Service";

import logoSpring from "./../../assets/img/spring-logo.png";
import logoSpark from "./../../assets/img/spark-logo.png";

function Java({location}){
    return (
        <div className={styles.containerJava}>
            <div className={styles.containerGraphic}>
                <div className={styles.graphic}>
                    Gr√°fico
                </div>
                <div className={styles.image}>
                    <img src={location.logo} alt="logo do java"/>
                </div>

            </div>
            <div className={styles.containerServices}>
                <Service 
                    nameService="Spring"
                    logo={logoSpring}
                    css={styles.spring}
                    path="/java/spring"
                />
                <Service 
                    nameService="Spark"
                    logo={logoSpark}
                    css={styles.spark}
                    path="/java/spark"
                />
            </div>
        </div>
    )
}

export default Java;
